import SinglePokemon from "./SinglePokemon";

const Pokemon = () => {
  // Rememeber state is data that changes, we want to to fetch our data from the backend/server
  // And store it in an array so we can add data if needed to it later
  // our initial state will be an empty array that we will fill with fetched data from the backend
